  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Stillwater Wildlife
  Management Area, Anaho Island NWR, Fallon NWR, and Winnemucca NWR outlines Refuge
  accomplishments from September through December of 1950. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments and collections and receipts. Resource management
  is outlined; topics include grazing and fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, fishing, and violations. N-R forms and photographs are attached.\",\n\t\"owner_org\":
